import './Stylesheet.css'

function Stylesheet() {

    const inlineCss = {
        fontSize:'50px',
        color:'skyblue'
    }
    return (
        <div>
            <h2 className='stylesheet'>Css using stylesheet</h2>
        </div>
    )
}

export default Stylesheet
